import "./Mainselect.css";
import data from "./Data3";
function Selitem(props) {
  let one = 2;
  data.properties.map((index) => {
    if (index.index === data.properties.index) {
      one = data.properties._id;
    }
  });
  return (
    <div className="class2">
      <div className="angle">
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[one].picture}
            alt="Loading..."
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[one].picture}
            alt="Loading..."
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[one].picture}
            alt="Loading..."
          />
        </div>
      </div>
      <div className="mainitem"></div>
      <div className="descrp"></div>
    </div>
  );
}
export default Selitem;
